function handleClick() {
  selectTrip(trip);
}

  return (
    <>
    <div className="icon-home">
                <Link to="/">
                    <AiTwotoneHome />
                </Link>
                </div>
    <li className="trips" >
      <NavLink to={`/tripCard/${trip.name}`}>
        <button className="button-4" onClick={handleClick}> {name} </button>
      </NavLink>
    </li>
    </>
  );
}

export default NavCard;
